import React from "react";
import { useDispatch } from "react-redux";
import { fetchDataAction } from "../R../edux/Actions";

export const TodaysMatchResults = () => {
  const dispatch = useDispatch();
  const result = dispatch(
    fetchDataAction({
      url:
        "https://api-football-v1.p.rapidapi.com/v2/fixtures/date/2020-02-06?timezone=Europe%252FLondon",
    })
  );
  console.log(result);
  return <div>yoyoyo</div>;
};
